import React from 'react';
import '../App.css';
import DormeterCard from './Cards/DormeterCard';
import ExcellenceCard from './Cards/ExcellenceCard';


function Showcase() {
    return (
        <div className='Showcase'>
            <h1>Showcase of my personal projects</h1>
          <DormeterCard />
          <ExcellenceCard />
        </div>
    );
};

export default Showcase;
